import React from 'react';
import Logo from '../assets/svg/header/Group 17 1.svg'
import btn1 from '../assets/svg/header/Cards.svg'

const Header: React.FC = () => {
    return (
        <header style={{display:'flex'}}>
            <img src={Logo}></img>
            <div style={{justifyContent: 'space-between',alignContent:'center'}}>
                <a>
                    <img src={btn1}></img>
                </a>
                <a>
                    <img src={btn1}></img>
                </a>
                <a>
                    <img src={btn1}></img>
                </a>
            </div>
        </header>
    );
};

export default Header;
